import React, { Fragment } from "react";
import "./style.scss"
import logo from "../../img/header_logo/logo.png";
// matrial ui
import MenuItem from '@material-ui/core/MenuItem';
import MenuList from '@material-ui/core/MenuList';
import MenuIcon from '@material-ui/icons/Menu';
import IconButton from '@material-ui/core/IconButton';
//react-icons
import { IconContext } from "react-icons";
import {ImFacebook,ImTwitter,ImLinkedin2} from "react-icons/im";
import {  } from "module";

// import { AiOutlineShoppingCart } from "react-icons/ai";



function navbar() {
    return(
        <Fragment>
            <div className="imagen"></div>
            <header>
                <div className="logo">
                    <img src={logo} className="img"/>
                </div>
                <navbar className="navbar">
                    <div className="social">
                        <IconContext.Provider className="iconContext" value={{color:'#686868'}}>
                            <ImFacebook/>
                            <ImTwitter/>
                            <ImLinkedin2/>
                        </IconContext.Provider>                       
                    </div>
                    
                    <MenuList className="menuList">
                        <MenuItem>HOME</MenuItem>
                        <MenuItem>PAGINAS</MenuItem>
                        <MenuItem>PORTAFOLIO</MenuItem>
                        <MenuItem>BLOG</MenuItem>
                        <MenuItem>TIENDA</MenuItem>
                        <MenuItem>ELEMENTOS</MenuItem>
                    </MenuList>
                  
                    <div className="">

                        <IconButton>
                               <MenuIcon />
                        </IconButton> 

                    </div>
                </navbar>
            </header>
                      
            
        </Fragment>
   )
    
}

export default navbar
